import './App.css';
import Navbar from './components/incl/navbar';
import TopBar from './components/incl/topbar';
import Users from './components/users/Users';


function App() {
  return (

    <div id="bg-default">


      <Navbar />


      <TopBar />
      <div className='main-content ss ' id='panel'>
        <Users />

      </div>
    </div>
  );
}

export default App;
